[gcode_macro CANCEL_PRINT]		#CANCEL_PRINT
description: Cancel the actual running print
rename_existing: BASE_CANCEL_PRINT
gcode:
    G91
    G1 Z+5 F600
    G90
    CLEAR_PAUSE
    SDCARD_RESET_FILE
	UPDATE_DELAYED_GCODE ID=filter_off DURATION=180
	MMU__EJECT
	G28 X Y
    TURN_OFF_HEATERS
	
[gcode_macro G32]#龙门架调平宏
gcode:
    BED_MESH_CLEAR
    G28
    QUAD_GANTRY_LEVEL
    G28
	G0 X150 Y150 Z30 F7200
	
[gcode_macro M109]
rename_existing: M99109
gcode:
    #Parameters
    {% set s = params.S|float %}
    
    M104 {% for p in params %}{'%s%s' % (p, params[p])}{% endfor %}  ; Set hotend temp
    {% if s != 0 %}
        TEMPERATURE_WAIT SENSOR=extruder MINIMUM={s} MAXIMUM={s+1}   ; Wait for hotend temp (within 1 degree)
    {% endif %}

[gcode_macro M190]
rename_existing: M99190
gcode:
    #Parameters
    {% set s = params.S|float %}

    M140 {% for p in params %}{'%s%s' % (p, params[p])}{% endfor %}   ; Set bed temp
    {% if s != 0 %}
        TEMPERATURE_WAIT SENSOR=heater_bed MINIMUM={s} MAXIMUM={s+1}  ; Wait for bed temp (within 1 degree)
    {% endif %}
	

[gcode_macro PRINT_START]#开始打印宏
#   Use PRINT_START for the slicer starting script - please customise for your slicer of choice
gcode:
	{% set BED_TEMP = params.BED_TEMP|default(100)|float %}
    {% set EXTRUDER_TEMP = params.EXTRUDER_TEMP|default(260)|float %}
	{% set CHAMBER_TEMP = params.CHAMBER|default(0)|int %}
	{% set PROBE_TEMP = params.PROBE_TEMP|default(150)|float %}
	
	{% if REFERENCED_TOOLS == "!referenced_tools!" %}
    RESPOND MSG="Happy Hare gcode pre-processor is diabled"
    {% set REFERENCED_TOOLS = INITIAL_TOOL %}
	{% elif REFERENCED_TOOLS == "" %}
    RESPOND MSG="Happy Hare single color print"
    {% set REFERENCED_TOOLS = INITIAL_TOOL %}
	{% endif %}
	
	{% if FILAMENT_TYPE == 'ABS' %}
        M141 S40
        TEMPERATURE_WAIT_SENSOR="Chamber" target=40
        RESPOND TYPE=echo MSG="Chamber for {FILAMENT_TYPE} set at {target_Chamber} / 40"
        
    {% elif FILAMENT_TYPE == 'PA-CF' %}
        M141 S45
        TEMPERATURE_WAIT_SENSOR="Chamber" target=45
        RESPOND TYPE=echo MSG="Chamber for {FILAMENT_TYPE} set at {target_Chamber} / 45"
	
	{% endif %}
	
	status_heating
	SET_FAN_SPEED FAN=Nevermore SPEED=1
	SET_FAN_SPEED FAN=EVENmore SPEED=0.5
	M190 S{BED_TEMP}
	M104 S{PROBE_TEMP}
	status_ready
    G92 E0 ;Reset Extruder                        
    BED_MESH_CLEAR
	status_homing
    G28
	G90
	status_leveling
	SET_DISPLAY_TEXT MSG="QGL"     							 # Displays info
	QUAD_GANTRY_LEVEL
	SET_DISPLAY_TEXT MSG="Bed Mesh Calibration"            # Display mesh calibration message	
	status_meshing
	BED_MESH_CALIBRATE
    BED_MESH_PROFILE LOAD=default
	status_heating
	SET_DISPLAY_TEXT MSG="Heating Nozzle: {EXTRUDER_TEMP}°C" # Display nozzle heating message
	M109 S{EXTRUDER_TEMP}
	status_ready
	SKEW_PROFILE LOAD=calilantern_skew_profile
	CLEAN_NOZZLE
	print_start_tune
	status_printing
	
	
[gcode_macro PRINT_END]#结束打印宏
#   Use PRINT_END for the slicer ending script - please customise for your slicer of choice
gcode:
    M400                           ; wait for buffer to clear
    G92 E0                         ; zero the extruder
    G1 E-10.0 F3600                ; retract filament
    G91                            ; relative positioning
    G0 Z5.00 X20.0 Y20.0 F10000    ; move nozzle to remove stringing
	TURN_OFF_HEATERS
    M107                           ; turn off fan
    G1 Z20 F3000                    ; move nozzle up 2mm
    G90                            ; absolute positioning
	G28 X Y
	BED_MESH_CLEAR
	UPDATE_DELAYED_GCODE ID=filter_off DURATION=180
	SET_SKEW CLEAR=1
	status_part_ready
	#end_tones
	M300 S440 P200
    M300 S660 P250
    M300 S880 P300

